'use strict';
({ params, imports }) => {
  const programEncounter = params.entity;
  const formElement = params.formElement;
  const FormElementStatus = imports.rulesConfig.FormElementStatus;

  // Set default status values
  let visibility = true;
  let value = null;
  let answersToSkip = [];
  let validationErrors = [];

  // UUID for the "Height" concept
  const heightConceptUUID = "d883d5fe-e17d-4136-b989-089fa0295e34";

  // Fetch the latest past encounter that has height recorded
  const latestEncounter = programEncounter.individual.latestEncounterWithObservation(heightConceptUUID);

  if (latestEncounter) {
    const heightObs = latestEncounter.getObservation(heightConceptUUID);
    if (heightObs && heightObs.value !== undefined && heightObs.value !== null) {
      value = heightObs.value; // Set the previously recorded height
    }
  }

  return new FormElementStatus(
    formElement.uuid,
    visibility,
    value,
    answersToSkip,
    validationErrors
  );
};

