'use strict';
({ params, imports }) => {
  const _ = imports.lodash;
  const programEncounter = params.entity;
  const formElement = params.formElement;
  const FormElementStatus = imports.rulesConfig.FormElementStatus;

  let visibility = true;
  let value = null;
  let answersToSkip = [];
  let validationErrors = [];

  // Loop through past encounters to find the one with height
  const heightConceptName = "Height [HP]"; // Use actual concept name, not UUID here

  const encounterWithHeight = _.find(
    programEncounter.individual.encounters,
    encounter => {
      return encounter.getObservation(heightConceptName) !== undefined;
    }
  );

  if (encounterWithHeight) {
    const heightObservation = encounterWithHeight.getObservation(heightConceptName);
    if (heightObservation && heightObservation.value !== undefined && heightObservation.value !== null) {
      value = heightObservation.value;
    }
  }

  // Use resetIfValueIsNull if value is null
  if (value === null || value === undefined) {
    return imports.rulesConfig.FormElementStatus.resetIfValueIsNull(
      formElement.uuid,
      visibility,
      value,
      answersToSkip,
      validationErrors
    );
  } else {
    return new FormElementStatus(
      formElement.uuid,
      visibility,
      value,
      answersToSkip,
      validationErrors
    );
  }
};

