({ params, imports }) => {
  const programEncounter = params.entity;
  const formElement = params.formElement;
  const _ = imports.lodash;

  let visibility = true;
  let value = [];
  let answersToSkip = [];
  let validationErrors = [];

  const rule = new imports.rulesConfig.RuleCondition({ programEncounter, formElement });

  // Concept UUID of "Lab Test Sample"
  const labSampleConceptUUID = "365ddf58-0ea4-4c91-8fa6-c39365626114";

  // Answer concept UUIDs and their labels
  const LabTestSample= {
    "05cfe27d-a3bb-4d8a-a5bc-04d5a5c36e96": "Blood",
    "494db4c4-e179-46a3-a7f9-c1ca8c483914": "Sputum",
