    "d0cd6117-72b1-4abf-b67b-215dab3ad03a":"Swab"
    // add more if needed
  };

  Object.entries(LabTestSample).forEach(([conceptUUID, label]) => {
    const matched = rule
      .when
      .latestValueInAllEncounters(labSampleConceptUUID)
      .containsAnswerConceptName(conceptUUID)
      .matches();

    if (matched) {
      value.push(label);
    }
  });

  // If no value matched, make it null
  if (value.length === 0) {
    value = null;
  }

  return new imports.rulesConfig.FormElementStatus(
    formElement.uuid,
    visibility,
    value,
    answersToSkip,
    validationErrors
  );
