    const labSample = programEncounter.getObservationValue('Lab Test Sample');
    console.log('Lab Test Sample UUID:', labSample);

    // UUID of "Blood" concept
    const bloodConceptUUID = '05cfe27d-a3bb-4d8a-a5bc-04d5a5c36e96';

    if (labSample === bloodConceptUUID) {
        decisions.encounterDecisions.push({
            name: "HTC, Other reason for test [H]",
            value: [bloodConceptUUID]
        });
    }

    return decisions;
};
